import React, { useState } from 'react';
import { photoCollections, photoData } from '../../data/photos';

interface PhotoCollection {
  id: string;
  name: string;
  path: string;
  photoCount: number;
}

interface Photo {
  id: string;
  name: string;
  path: string;
  collection: string;
}

const PhotoGallery: React.FC = () => {
  const [activeCollection, setActiveCollection] = useState<string>('california-summer');
  const [viewMode, setViewMode] = useState<'grid' | 'list'>('grid');

  // Use real photo data from the generated file
  const collections: PhotoCollection[] = photoCollections;
  const allPhotos: Photo[] = photoData;

  const currentPhotos = allPhotos.filter(photo => photo.collection === activeCollection);
  const currentCollection = collections.find(col => col.id === activeCollection);

  const handleCollectionClick = (collectionId: string) => {
    setActiveCollection(collectionId);
  };

  const handlePhotoClick = (photo: Photo) => {
    // TODO: Implement full-screen photo view
    console.log('Opening photo:', photo.name);
  };

  return (
    <div style={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
      <div style={{ 
        background: 'linear-gradient(90deg, #000080, #1084d0)', 
        color: 'white', 
        padding: '15px 20px',
        borderBottom: '1px solid #2e5a8f'
      }}>
        <h2 style={{ margin: '0 0 5px 0', fontSize: '20px', fontWeight: '600' }}>
          Photo Gallery
        </h2>
        <p style={{ margin: '5px 0 0 0', opacity: '0.9', fontSize: '14px' }}>
          Browse your photography collections
        </p>
      </div>

      <div style={{ flex: 1, display: 'flex', overflow: 'hidden' }}>
        <div style={{ 
          width: '250px', 
          background: '#c0c0c0', 
          borderRight: '1px solid #808080',
          overflowY: 'auto',
          padding: '20px'
        }}>
          {collections.map(collection => (
            <div
              key={collection.id}
              style={{
                padding: '15px',
                marginBottom: '10px',
                borderRadius: '4px',
                cursor: 'pointer',
                background: activeCollection === collection.id ? '#000080' : '#dfdfdf',
                color: activeCollection === collection.id ? 'white' : '#222222',
                border: '1px solid #808080',
                boxShadow: activeCollection === collection.id ? 'inset -1px -1px #000000, inset 1px 1px #ffffff' : 'inset -1px -1px #ffffff, inset 1px 1px #808080'
              }}
              onClick={() => handleCollectionClick(collection.id)}
            >
              <div style={{ fontWeight: '600', fontSize: '16px', marginBottom: '5px' }}>
                {collection.name}
              </div>
              <div style={{ fontSize: '12px', opacity: '0.8' }}>
                {collection.photoCount} photos
              </div>
            </div>
          ))}
        </div>

        <div style={{ flex: 1, padding: '20px', overflowY: 'auto', background: '#c0c0c0' }}>
          <div style={{ 
            display: 'flex', 
            justifyContent: 'space-between', 
            alignItems: 'center',
            marginBottom: '20px',
            paddingBottom: '15px',
            borderBottom: '2px solid #808080'
          }}>
            <h3 style={{ margin: '0', color: '#222222', fontSize: '18px' }}>
              {currentCollection?.name} ({currentPhotos.length} photos)
            </h3>
            <div style={{ display: 'flex', gap: '10px' }}>
              <button 
                className={viewMode === 'grid' ? 'default' : ''}
                onClick={() => setViewMode('grid')}
              >
                Grid
              </button>
              <button 
                className={viewMode === 'list' ? 'default' : ''}
                onClick={() => setViewMode('list')}
              >
                List
              </button>
            </div>
          </div>

          {currentPhotos.length > 0 ? (
            <div style={{ 
              display: 'grid',
              gridTemplateColumns: 'repeat(auto-fill, minmax(150px, 1fr))',
              gap: '15px',
              padding: '10px 0'
            }}>
              {currentPhotos.map(photo => (
                <div 
                  key={photo.id} 
                  style={{
                    position: 'relative',
                    borderRadius: '4px',
                    overflow: 'hidden',
                    cursor: 'pointer',
                    border: '2px solid transparent',
                    background: '#ffffff',
                    boxShadow: 'inset -1px -1px #ffffff, inset 1px 1px #808080'
                  }}
                  onClick={() => handlePhotoClick(photo)}
                >
                  <div style={{
                    width: '100%',
                    height: '120px',
                    backgroundImage: `url(${photo.path})`,
                    backgroundSize: 'cover',
                    backgroundPosition: 'center',
                    backgroundRepeat: 'no-repeat'
                  }} />
                  <div style={{
                    padding: '8px',
                    fontSize: '12px',
                    color: '#222222',
                    background: '#ffffff',
                    textAlign: 'center',
                    fontWeight: '500'
                  }}>
                    {photo.name}
                  </div>
                </div>
              ))}
            </div>
          ) : (
            <div style={{ textAlign: 'center', padding: '60px 20px', color: '#666' }}>
              <div style={{ fontSize: '48px', marginBottom: '20px', opacity: '0.5' }}>ðŸ“·</div>
              <h3>No photos in this collection yet</h3>
              <p>Add some photos to get started!</p>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default PhotoGallery;
